import React, { useContext } from 'react';
import PropTypes from 'prop-types';
import { Text, View, StyleSheet } from '@react-pdf/renderer';
import Title from '../Components/Title';
import LeftContainer from '../Components/LeftContainer';
import { UserStateContext } from 'context/user';

const styles = StyleSheet.create({
  container: {
    marginBottom: 16,
  },
  body: {
    fontSize: 10,
    marginBottom: '4px',
    lineHeight: 1.4,
  },
});

const Profile = ({profile}) => {
  const state = useContext(UserStateContext)
  console.log(state)
  return (
    <LeftContainer>
        <Title>Profil</Title>
        <Text style={styles.body}>{profile}</Text>
    </LeftContainer>
  )
}


Profile.propTypes = {
    profile: PropTypes.string,
};

Profile.defaultProps = {
    profile: 'Karl är en driven och skicklig webb- och systemutvecklare med stor erfarenhet av både frontend- och backendutveckling. Han har stor kompetens inom Python och JavaScript och jobbat med flertalet ramverk som AIOHTTP, Flask, React och Node.js. I projekt finner Karl en stor tillfredsställelse i att utveckla sin kunskap och lösa tekniska problem, oberoende av plattform och utvecklingsspråk. Han är en tävlingsinriktad person som alltid är mån om att leverera väl fungerande och genomtänkta lösningar. Han trivs med att arbeta med tuffa utmaningar tillsammans med andra drivna och kunniga människor.',
};

export default Profile;
